SELECT DISTINCT "investinfo_data"."id", "investinfo_data"."ticker_id", "investinfo_data"."datetime", "investinfo_data"."open", "investinfo_data"."high", "investinfo_data"."low", "investinfo_data"."close", "investinfo_data"."adjclose", "investinfo_data"."volume" FROM "investinfo_data" WHERE ("investinfo_data"."datetime" >= '2020-09-19 21:00:00' AND "investinfo_data"."ticker_id" = 'A') ORDER BY "investinfo_data"."datetime" ASC